import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './Nav.css';
const logo = {
   id:"https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSQIZpaBLLOgWZPbPYdXozI1N1O3ayDAHrvnPAwSGY9S-EUgdIB&usqp=CAU" 
    }
class Nav extends Component {
    state = {  }
    
    render() { 
        return (
            <div >
                <nav>
                    <img src=
                    {logo.id}></img>
                    <Link>
                    <li>Home</li>
                    </Link>

                    <Link>
                    <li>About</li>
                    </Link>
                    
                    <Link>
                    <li>Resources</li>
                    </Link>

                </nav>
            </div>
          );
    }
}

export default Nav;
